Een overwerkte manager van een luxe appartementencomplex heeft samen met zijn personeel zijn pensioen verloren aan het 
piramidespel van een Wall Street crimineel. De fraudeur woont in een groot penthouse onder huisarrest. Onder leiding van de 
manager gebruiken de medewerkers hun kennis van het gebouw om de fraudeur een poot uit te draaien.
